wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u043e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0434\u0435\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BE%D1%82%D0%B5%D1%80%D0%B3%D0%B5%D0%B9%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BA%D0%B0%D0%BD%D0%B4%D0%B0%D0%BB\" title=\"\u0423\u043e\u0442\u0435\u0440\u0433\u0435\u0439\u0442\u0441\u043a\u0438\u0439 \u0441\u043a\u0430\u043d\u0434\u0430\u043b\">\u0423\u043e\u0442\u0435\u0440\u0433\u0435\u0439\u0442\u0441\u043a\u0438\u0445 \u0432\u043e\u0440\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974\" class=\"mw-redirect\" title=\"1974\">1974<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D0%B9%D0%BF%D1%82%D0%B0%D1%83%D0%BD\" title=\"\u041a\u0435\u0439\u043f\u0442\u0430\u0443\u043d\">\u041a\u0435\u0439\u043f\u0442\u0430\u0443\u043d\u0435<\/a> \u0443 \u0421\u044c\u044e \u0420\u043e\u0437\u0435\u043d\u043a\u043e\u0432\u0438\u0446 \u0440\u043e\u0434\u0438\u043b\u0438\u0441\u044c \u0448\u0435\u0441\u0442\u0435\u0440\u043e \u0431\u043b\u0438\u0437\u043d\u0435\u0446\u043e\u0432, \u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u0441\u0435 \u0440\u043e\u0436\u0434\u0451\u043d\u043d\u044b\u0435 \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0434\u0435\u0442\u0438 \u0432\u044b\u0436\u0438\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1976_%D0%B3%D0%BE%D0%B4\" title=\"1976 \u0433\u043e\u0434\">1976<\/a>&#160;\u2014 \u0412\u043e