043f\u0435\u0434\u0438\u0446\u0438\u044e \u043f\u043e \u043f\u0435\u0440\u0435\u0441\u0435\u0447\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u043a\u0430\">\u0410\u043d\u0442\u0430\u0440\u043a\u0442\u0438\u043a\u0438<\/a>, \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BA%D0%BE%D1%82%D1%82-%D0%91%D0%B5%D0%B9%D1%81\" title=\"\u0421\u043a\u043e\u0442\u0442-\u0411\u0435\u0439\u0441\">\u0421\u043a\u043e\u0442\u0442-\u0411\u0435\u0439\u0441<\/a> \u043f\u043e\u0441\u043b\u0435 75 \u0434\u043d\u0435\u0439 \u043f\u0443\u0442\u0438, \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0431\u044b\u043b\u043e \u043f\u0440\u043e\u0439\u0434\u0435\u043d\u043e 2500 \u043c\u0438\u043b\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b \u0440\u0430\u0431\u043e\u0442\u0443 \u043d\u043e\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\">\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442<\/a> \u0420\u043e\u0441\u0441\u0438\u0438&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B5_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\">\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a>, \u0438\u0437\u0431\u0440\u0430\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/12_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D1%8F\" title=\"12 \u0434\u0435\u043a\u0430\u0431\u0440\u044f\">12 \u0434\u0435\u043a\u0430\u0431\u0440\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993 \u0433\u043e\u0434\u0430<\/a> \u0438 \u0441\u043e\u0441\u0442\u043e\u044f\u0449\u0438\u0439 \u0438\u0437 \u0434\u0432\u0443\u0445 \u043f\u0430\u043b\u0430\u0442: \u0432\u0435\u0440\u0445\u043d\u0435\u0439&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" title=\"\u0421\u043e\u0432\u0435\u0442 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\">\u0421\u043e\u0432\u0435\u0442\u0430 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a> \u0438 \u043d\u0438\u0436\u043d\u0435\u0439&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B4%D1%83%D0%BC%D0%B0\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0434\u0443\u043c\u0430\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0434\u0443\u043c\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 \u041f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u044f\">\u0418\u0440\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u043e\u0442\u043c\u0435\u043d\u0438\u043b\u043e 20-\u043b\u0435\u0442\u043d\u0438\u0439 \u0437\u0430\u043f\u0440\u0435\u0442 \u043d\u0430 \u0442\u0435\u043b\u0435- \u0438 \u0440\u0430\u0434\u0438\u043e\u0442\u0440\u0430\u043d\u0441\u043b\u044f\u0446\u0438\u044e \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0418\u0440\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u0418\u0440\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f<\/a> (\u0418\u0420\u0410) \u0438 \u0435\u0451 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u044b\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B8%D0%BD%D0%BD_%D0%A4%D0%B5%D0%B9%D0%BD\" title=\"\u0428\u0438\u043d\u043d \u0424\u0435\u0439\u043d\">\u0428\u0438\u043d\u043d \u0424\u0435\u0439\u043d<\/a>\u00bb.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003_%D0%B3%D0%BE%D0%B4\" title=\"2003 \u0433\u043e\u0434\">2003<\/a>&#160;\u2014 \u0413\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440 \u0448\u0442\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D0%BB%D0%B8%D0%BD%D0%BE%D0%B9%D1%81\" title=\"\u0418\u043b\u043b\u0438\u043d\u043e\u0439\u0441\">\u0418\u043b\u043b\u0438\u043d\u043e\u0439\u0441<\/a> \u043f\u043e\u043c\u0438\u043b\u043e\u0432\u0430\u043b 150 \u043e\u0441\u0443\u0436\u0434\u0451\u043d\u043d\u044b\u0445 \u043d\u0430 \u0432\u044b\u0441\u0448\u0443\u044e \u043c\u0435\u0440\u0443 \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u044f&#160;\u2014 \u0432\u0441\u0435\u0445 \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d\u043d\u044b\u0445-\u0441\u043c\u0435\u0440\u0442\u043d\u0438\u043a\u043e\u0432 \u0418\u043b\u043b\u0438\u043d\u043e\u0439\u0441\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D1%81_%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4%D0%BE%D0%BC_%E2%84%96_1908\" title=\"\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0441 \u043f\u043e\u0435\u0437\u0434\u043e\u043c \u2116 1908\">\u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0441 \u043f\u043e\u0435\u0437\u0434\u043e\u043c \u2116 1908<\/a>, \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e, \u0438\u0437-\u0437\u0430 \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0441\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430 \u043c\u0430\u0448\u0438\u043d\u0438\u0441\u0442\u0430, \u0442\u044f\u0436\u0451\u043b\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%83%D0%B7%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4\" title=\"\u0413\u0440\u0443\u0437\u043e\u0432\u043e\u0439 \u043f\u043e\u0435\u0437\u0434\">\u0433\u0440\u0443\u0437\u043e\u0432\u043e\u0439 \u043f\u043e\u0435\u0437\u0434<\/a> \u0432\u0435\u0441\u043e\u043c 5175 \u0442\u043e\u043d\u043d \u043f\u0440\u043e\u0435\u0445\u0430\u043b \u0440\u044f\u0434 \u0441\u0442\u0430\u043d\u0446\u0438\u0439, \u043d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u044e\u0449\u0438\u0435 \u043f\u043e\u043a\u0430\u0437\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D1%81%D0%B2%D0%B5%D1%82%D0%BE%D1%84%D0%BE%D1%80\" title=\"\u0416\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0439 \u0441\u0432\u0435\u0442\u043e\u0444\u043e\u0440\">\u0441\u0432\u0435\u0442\u043e\u0444\u043e\u0440\u043e\u0432<\/a>. \u041e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u0438 \u0435\u0433\u043e \u043b\u0438\u0448\u044c \u043f\u0443\u0442\u0451\u043c \u043e\u0442\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u044d\u043d\u0435\u0440\u0433\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2011_%D0%B3%D0%BE%D0%B4\" title=\"2011 \u0433\u043e\u0434\">2011<\/a>&#160;\u2014 \u041f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0430 \u043e\u0431\u0449\u0430\u044f \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Windows_XP\" title=\"Windows XP\">Windows XP Service Pack 3<\/a>.<\/li><\/ul><h2>"}